import React, {useState, useMemo, useEffect} from 'react';
import Header from './Header';

function DisplayData ({excelData}) {

  const [computedData, setComputedData] = useState([]);

  useEffect(() =>{
    console.log('abc')
   var data = excelData.filter((v,i,a)=>a.findIndex(t=>(t.username === v.username)===i))
   console.log(data);
   setComputedData(data);
  },[]);

  const [sorting, setSorting] = useState({ field: "", order: "" });

  const headers = [
    { name: "SORTSEGS", field: "SORTSEGS", sortable: false },
    { name: "MINMAXSWAP", field: "MINMAXSWAP", sortable: false },
    { name: "TSP", field: "TSP", sortable: false },
    { name: "RNDCHULL", field: "RNDCHULL", sortable: false },
    { name: "ONECHANGE", field: "ONECHANGE", sortable: false },
    { name: "Result", field: "result_code", sortable: true }
  ];

  let convertToLocalTime = (timeStr) =>{
    var date = new Date(timeStr);
    var strDate = date.getHours() +':'+ date.getMinutes() +':'+ date.getSeconds();
    return strDate;
  }

  let getTotalScore = (individualExcelData) => {
    let c=0;
     let filteredData =  excelData.filter(data => data.username === individualExcelData.username && data.result_code == 15);
     filteredData.map(res => {
        c += res.result_code;
     });

    return c;
  }

  let getProblemScore = (individualExcelData) => {
     var s1 = '?', s2 = '?', s3 = '?', s4 = '?', s5 = '?';
     let filteredData =  excelData.filter(data => data.username === individualExcelData.username);
     filteredData.map(res => {
        switch(res.problem_code)
        {
          case 'SORTSEGS' : s1 = res.result_code;
                            break;
          case 'MINMAXSWAP' : s2 = res.result_code;
                            break;
          case 'TSP': s3 = res.result_code;
                            break;
          case 'RNDCHULL' : s4 = res.result_code;
                            break;
          case 'ONECHANGE' : s5 = res.result_code;

        }              
     });

    return(
      <>
      <td>{s1}</td>
      <td>{s2}</td>
      <td>{s3}</td>
      <td>{s4}</td>
      <td>{s5}</td>
      </>
    );
  }

  const sortedData = useMemo(() => {

    //Sorting comments
    if (sorting.field) {
        /*const reversed = sorting.order === "asc" ? 1 : -1;
        computedData = computedData.sort(
            (a, b) => (
              reversed * (getTotalScore(a) - getTotalScore(b)),
              console.log(a)
            )         
        );*/
         console.log("data:"+ excelData);
        const data = [].concat(computedData)
        .sort((a, b) => getTotalScore(a) > getTotalScore(b) ? 1 : -1)

    }
    }, [excelData,sorting]);

  return( 
  <div className="DataWrapper">
     {excelData===null&&<>No file selected</>}
        {excelData!==null&&(
          <div>
            <table className='table1 '>
             <Header
                  headers={headers}
                  onSorting={(field, order) =>
                  setSorting({ field, order })
                   }
             />
              <thead>
                <tr>
                    <th>Username</th>
                    <th>Gender</th>
                    <th>Country Code</th>
                    <th>Country Name</th>
                    <th >Submission Id</th>    
                    <th >Submission Date</th>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <td>15</td>
                    <th>75</th>     
                  </tr>                
               </thead>

           <tbody>
            {computedData.map((individualExcelData)=>(
                   <tr key={individualExcelData.username}>
                    <td >{individualExcelData.username}</td>
                    <td >{individualExcelData.gender}</td>
                    <td >{individualExcelData.country_code}</td>
                    <td >{individualExcelData.country_name}</td>
                    <td >{individualExcelData.submission_id}</td>
                    <td >{convertToLocalTime(individualExcelData.submission_date)}</td>
                    {getProblemScore(individualExcelData)}
                    <td >{getTotalScore(individualExcelData)}</td>
                  </tr>   
                 ))

                }
             </tbody>   
           </table>  
        </div>       
        )}       
  </div>);
}


export default DisplayData;
